import React, { Component } from 'react'
import Item from '../Item'
import './index.css'

export default class List extends Component {
    render() {

        const {todos} = this.props;
        return (
            <ul className="todo-main">
                {
                    todos.map(item=>{
                        return <Item key={item.id} name={item.name} id={item.id}/>
                    })
                }
            </ul>
        )
    }
}
